CREATE DEFINER=`root`@`localhost` PROCEDURE `actualizar_meses_para_pagados` ()   BEGIN
    -- Actualizar creditos_data para usuarios con pagado = 1
    UPDATE creditos_data 
    SET meses = meses + 1
    WHERE user_id IN (SELECT id FROM user_data) 
      AND pagado = 1;

    -- Actualizar cobros_data para usuarios con pagado = 1
