CREATE DEFINER=`root`@`localhost` FUNCTION `CalcularAntiguedadPrecisa` (`user_id` INT) RETURNS DECIMAL(10,2) DETERMINISTIC BEGIN
    DECLARE antiguedad DECIMAL(10,2);

    SELECT TIMESTAMPDIFF(DAY, date, CURDATE()) / 365.0 INTO antiguedad
    FROM user_data
    WHERE id = user_id;

    RETURN antiguedad;
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `CalcularNivelCrediticio` (`user_id` INT) RETURNS DECIMAL(10,2) DETERMINISTIC BEGIN
    DECLARE antiguedad DECIMAL(10,2);
    DECLARE pago_sin_mes DECIMAL(10,2);
    DECLARE porcentaje DECIMAL(10,2);
    DECLARE porcentaje_limite DECIMAL(10,2);
    DECLARE promedio DECIMAL(10,2);
    DECLARE nivel_crediticio DECIMAL(10,2);
    DECLARE nivel_anterior DECIMAL(10,2);

    -- Calcular la antigüedad precisa * 0.1 (no debe superar 1)
    SET antiguedad = LEAST(CalcularAntiguedadPrecisa(user_id) * 0.1, 1);

    -- Calcular el pago sin mes / 100 * 0.5
    SET pago_sin_mes = (CalcularPagoSinMes(user_id) / 100) * 0.5;

    -- Calcular el porcentaje / 100 * 0.2
    SET porcentaje = (CalcularPorcentaje(user_id) / 100) * 0.2;

    -- Calcular el porcentaje del límite / 100 * 0.2
    SET porcentaje_limite = (CalcularPorcentajeLimite(user_id) / 100) * 0.2;

    -- Calcular el promedio / 100 * 0.2
    SET promedio = CalcularPromedio(user_id) * 0.2;

    -- Consultar el nivel actual en crediticio_data
    SELECT IFNULL(level, 0) INTO nivel_anterior
    FROM crediticio_data
    WHERE user_id = user_id;

    -- Si existe nivel anterior, calcular la media
    IF nivel_anterior > 0 THEN
        SET nivel_crediticio = ((antiguedad + pago_sin_mes + porcentaje + porcentaje_limite + promedio + nivel_anterior) / 2);
    ELSE
        -- Si no existe nivel anterior, solo sumar los resultados
        SET nivel_crediticio = (antiguedad + pago_sin_mes + porcentaje + porcentaje_limite + promedio);
    END IF;
    VALUES (user_id, nivel_crediticio)
    ON DUPLICATE KEY UPDATE level = nivel_crediticio;
    -- Devolver el resultado calculado
    RETURN nivel_crediticio;
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `CalcularPagoSinMes` (`user_id` INT) RETURNS DECIMAL(5,2) DETERMINISTIC BEGIN
    DECLARE Cd INT DEFAULT 0;    -- Total de días adicionales
    DECLARE Ct INT DEFAULT 0;    -- Total de transacciones válidas
    DECLARE dias_diff INT;
    DECLARE transacciones INT;

    -- Calcular para Tarjetas (tarjetas_id > 1)
    SELECT SUM(CASE 
                  -- Si NO existe en pagos_data y es de un mes anterior
                  WHEN p.unique_id IS NULL AND MONTH(t.date) < MONTH(CURRENT_DATE) THEN 
                      LEAST(GREATEST(DATEDIFF(CURRENT_DATE, LAST_DAY(DATE_ADD(t.date, INTERVAL 1 MONTH))) - 6, 0), 24)
                  -- Si existe en pagos_data y la fecha de pago es posterior al mes de la transacción
                  WHEN p.unique_id IS NOT NULL AND MONTH(t.date) < MONTH(p.date) THEN 
                      LEAST(GREATEST(DATEDIFF(p.date, LAST_DAY(t.date)) - 6, 0), 24)
                  -- Si la fecha de la transacción está en el futuro, no contar
                  WHEN MONTH(t.date) > MONTH(CURRENT_DATE) THEN 0
                  ELSE 0
                END) AS Cd,
           COUNT(CASE 
                  -- Solo contar las transacciones que generen días adicionales (y no futuras)
                  WHEN p.unique_id IS NULL AND MONTH(t.date) < MONTH(CURRENT_DATE) THEN 1
                  WHEN p.unique_id IS NOT NULL AND MONTH(t.date) < MONTH(p.date) THEN 1
                  ELSE NULL
                END) AS transacciones
    INTO dias_diff, transacciones
    FROM tarjeta_data t
    LEFT JOIN pagos_data p ON t.unique_id = p.unique_id
                            AND t.user_id = p.user_id
                            AND p.tipo_pago = 1
    WHERE t.user_id = user_id
    AND t.tarjetas_id > 1;

    -- Sumar los resultados de tarjetas
    SET Cd = Cd + dias_diff;
    SET Ct = Ct + transacciones;

    -- Actualizar 'pagado' para Tarjetas
    UPDATE tarjeta_data 
    SET pagado = 1
    WHERE user_id = user_id
    AND unique_id IN (SELECT unique_id FROM pagos_data WHERE user_id = user_id AND tipo_pago = 1);

    -- Calcular para Seguros
    SELECT SUM(CASE 
                  -- Si NO existe en pagos_data y es de un mes anterior
                  WHEN p.unique_id IS NULL AND MONTH(s.date) < MONTH(CURRENT_DATE) THEN 
                      LEAST(GREATEST(DATEDIFF(CURRENT_DATE, LAST_DAY(DATE_ADD(s.date, INTERVAL 1 MONTH))) - 6, 0), 24)
                  -- Si existe en pagos_data y la fecha de pago es posterior al mes de la transacción
                  WHEN p.unique_id IS NOT NULL AND MONTH(s.date) < MONTH(p.date) THEN 
                      LEAST(GREATEST(DATEDIFF(p.date, LAST_DAY(s.date)) - 6, 0), 24)
                  -- Si la fecha de la transacción está en el futuro, no contar
                  WHEN MONTH(s.date) > MONTH(CURRENT_DATE) THEN 0
                  ELSE 0
                END) AS Cd,
           COUNT(CASE 
                  -- Solo contar las transacciones que generen días adicionales (y no futuras)
                  WHEN p.unique_id IS NULL AND MONTH(s.date) < MONTH(CURRENT_DATE) THEN 1
                  WHEN p.unique_id IS NOT NULL AND MONTH(s.date) < MONTH(p.date) THEN 1
                  ELSE NULL
                END) AS transacciones
    INTO dias_diff, transacciones
    FROM seguros_data s
    LEFT JOIN pagos_data p ON s.unique_id = p.unique_id
                            AND s.user_id = p.user_id
                            AND p.tipo_pago = 2
    WHERE s.user_id = user_id;

    -- Sumar los resultados de seguros
    SET Cd = Cd + dias_diff;
    SET Ct = Ct + transacciones;

    -- Actualizar 'pagado' para Seguros
    UPDATE seguros_data 
    SET pagado = 1
    WHERE user_id = user_id
    AND unique_id IN (SELECT unique_id FROM pagos_data WHERE user_id = user_id AND tipo_pago = 2);

    -- Calcular para Créditos
    SELECT SUM(CASE 
                  -- Si NO existe en pagos_data y es de un mes anterior
                  WHEN p.unique_id IS NULL AND MONTH(c.date) < MONTH(CURRENT_DATE) THEN 
                      LEAST(GREATEST(DATEDIFF(CURRENT_DATE, LAST_DAY(DATE_ADD(c.date, INTERVAL 1 MONTH))) - 6, 0), 24)
                  -- Si existe en pagos_data y la fecha de pago es posterior al mes de la transacción
                  WHEN p.unique_id IS NOT NULL AND MONTH(c.date) < MONTH(p.date) THEN 
                      LEAST(GREATEST(DATEDIFF(p.date, LAST_DAY(c.date)) - 6, 0), 24)
                  -- Si la fecha de la transacción está en el futuro, no contar
                  WHEN MONTH(c.date) > MONTH(CURRENT_DATE) THEN 0
                  ELSE 0
                END) AS Cd,
           COUNT(CASE 
                  -- Solo contar las transacciones que generen días adicionales (y no futuras)
                  WHEN p.unique_id IS NULL AND MONTH(c.date) < MONTH(CURRENT_DATE) THEN 1
                  WHEN p.unique_id IS NOT NULL AND MONTH(c.date) < MONTH(p.date) THEN 1
                  ELSE NULL
                END) AS transacciones
    INTO dias_diff, transacciones
    FROM creditos_data c
    LEFT JOIN pagos_data p ON c.unique_id = p.unique_id
                            AND c.user_id = p.user_id
                            AND p.tipo_pago = 3
    WHERE c.user_id = user_id;

    -- Sumar los resultados de créditos
    SET Cd = Cd + dias_diff;
    SET Ct = Ct + transacciones;

    -- Actualizar 'pagado' para Créditos
    UPDATE creditos_data 
    SET pagado = 1
    WHERE user_id = user_id
    AND unique_id IN (SELECT unique_id FROM pagos_data WHERE user_id = user_id AND tipo_pago = 3);

    -- Calcular y devolver el resultado
    IF Ct > 0 THEN
