    END IF;
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `CalcularPorcentaje` (`user_id` INT) RETURNS DECIMAL(5,2) DETERMINISTIC BEGIN
    DECLARE total_income DECIMAL(10,2);
    DECLARE total_sum DECIMAL(10,2);
    DECLARE porcentaje DECIMAL(5,2);

    -- Obtener el ingreso total del usuario
    SELECT income INTO total_income
    FROM user_data
    WHERE id = user_id;

    -- Calcular la suma total de movimiento, monto_mes y monto
    SELECT 
        IFNULL(SUM(tarjeta.movimiento), 0) + 
        IFNULL(SUM(seguros.monto_mes), 0) + 
        IFNULL(SUM(creditos.monto), 0) INTO total_sum
    FROM tarjeta_data AS tarjeta
    LEFT JOIN seguros_data AS seguros ON tarjeta.user_id = seguros.user_id
    LEFT JOIN creditos_data AS creditos ON tarjeta.user_id = creditos.user_id
    WHERE tarjeta.user_id = user_id;

    -- Calcular el porcentaje que representa la suma en relación al ingreso
    IF total_income > 0 THEN
        SET porcentaje = (total_sum / total_income) * 100;
    ELSE
        SET porcentaje = 0; -- Si no hay ingreso, el porcentaje es 0
    END IF;

    RETURN porcentaje;
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `CalcularPorcentajeLimite` (`user_id` INT) RETURNS DECIMAL(10,2) DETERMINISTIC BEGIN
    DECLARE total_depositos DECIMAL(10,2);
    DECLARE total_limite DECIMAL(10,2);
    DECLARE porcentaje_utilizado DECIMAL(10,2);

    -- Calcular la suma total de depósitos para el usuario y tarjetas_id > 1
    SELECT IFNULL(SUM(td.deposito), 0) INTO total_depositos
    FROM tarjeta_data AS td
    JOIN tarjetas_id AS ti ON td.tarjetas_id = ti.unique_id
    WHERE td.user_id = user_id AND td.tarjetas_id > 1;

    -- Calcular el límite total de tarjetas asociadas a los depósitos del usuario y tarjetas_id > 1
    SELECT IFNULL(SUM(ti.limite), 0) INTO total_limite
    FROM tarjetas_id AS ti
    WHERE ti.unique_id IN (
        SELECT td.tarjetas_id
        FROM tarjeta_data AS td
        WHERE td.user_id = user_id AND td.tarjetas_id > 1
    );

    -- Calcular el porcentaje del límite utilizado
    IF total_limite > 0 THEN
        SET porcentaje_utilizado = (total_depositos / total_limite) * 100;
    ELSE
        SET porcentaje_utilizado = 0; -- Si no hay límite definido, el porcentaje es 0
    END IF;

    RETURN porcentaje_utilizado;
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `CalcularPromedio` (`user_id` INT) RETURNS DECIMAL(10,2) DETERMINISTIC BEGIN
    DECLARE total_seguros INT;
    DECLARE total_creditos INT;
    DECLARE promedio DECIMAL(10,2);

    -- Sumar los seguros_id
    SELECT COUNT(*) INTO total_seguros
    FROM seguros_data
    WHERE user_id = user_id;

    -- Sumar los tipo_credito
    SELECT COUNT(*) INTO total_creditos
    FROM creditos_data
    WHERE user_id = user_id;

    -- Calcular el promedio dividiendo por 7
    SET promedio = (total_seguros + total_creditos) / 7;

    RETURN promedio;
END$$

